You may have heard of transformations before when talking about a wedding space, but I don’t think you’ve really seen what that means! When we told people where exactly Sierra and Jonathan’s Reception would take place, they typically gave us a “oh, that’s nice…” because everyone knew that the Cultural Center (Church fellowship hall) did leave a lot to be desired. But I saw the potential!!! Thankfully we had a full day to set and begin the transformation the day before. We started at 9am and while my video only captured about 6 hours, I had to leave and go set up the rehearsal dinner, the team stayed for about three more hours after I left. Then we came back the next day at 9am again to place all the finishing touches! It truly was such a dream team. We could not have done this without them!

